                sp = arr[i].split('?')

                    sp = sp[1].split('&')
                    for (let j = 0; j < sp.length; j++) {

                        }
                    }

                }
            }
            return result

            var sp = document.cookie.split(';')
            var result = []

                        result.push(sp2[0])
                    }
                }
            }
